INSERT INTO `profil` (`user_id`, `gender`, `orientation`, `bio`, `popularity`, `birthdate`) VALUES
(1430, 'Male', 'Female', 'Age is an issue of mind over matter. If you don t mind, it doesn t matter.', 35, '1993-07-18'),
(1431, 'Male', 'Female', 'Anyone who stops learning is old, whether at twenty or eighty. Anyone who keeps learning stays young. The greatest thing in life is to keep your mind young.', 52, '1981-03-17'),
(1432, 'Female', 'Male', 'Wrinkles should merely indicate where smiles have been.', 67, '1990-06-21'),
(1433, 'Male', 'Female', 'True terror is to wake up one morning and discover that your high school class is running the country.', 21, '1982-02-13'),
(1434, 'Male', 'Female', 'A diplomat is a man who always remembers a woman s birthday but never remembers her age.', 38, '1985-09-17'),
(1435, 'Male', 'Female', 'As I grow older, I pay less attention to what men say. I just watch what they do.', 79, '1975-01-08'),
(1436, 'Female', 'Male', 'How incessant and great are the ills with which a prolonged old age is replete.', 37, '1993-06-19'),
(1437, 'Male', 'Female', 'Old age, believe me, is a good and pleasant thing. It is true you are gently shouldered off the stage, but then you are given such a comfortable front stall as spectator.', 67, '1993-05-21'),
(1438, 'Male', 'Female', 'Old age has deformities enough of its own. It should never add to them the deformity of vice.', 65, '1988-06-17'),
(1439, 'Female', 'Male', 'Nobody grows old merely by living a number of years. We grow old by deserting our ideals. Years may wrinkle the skin, but to give up enthusiasm wrinkles the soul.', 53, '1999-07-11'),
(1440, 'Female', 'Male', 'An archaeologist is the best husband a woman can have. The older she gets the more interested he is in her.', 64, '1977-11-13'),
(1441, 'Male', 'Female', 'All diseases run into one, old age.', 11, '1986-01-04'),
(1442, 'Male', 'Female', 'Bashfulness is an ornament to youth, but a reproach to old age.', 58, '1986-04-11'),
(1443, 'Female', 'Male', 'Like everyone else who makes the mistake of getting older, I begin each day with coffee and obituaries.', 2, '1989-10-30'),
(1444, 'Female', 'Male', 'Age appears to be best in four things old wood best to burn, old wine to drink, old friends to trust, and old authors to read.', 94, '1980-03-29'),
(1445, 'Female', 'Male', 'None are so old as those who have outlived enthusiasm.', 36, '1974-06-28'),
(1446, 'Male', 'Female', 'Every man over forty is a scoundrel.', 62, '1985-09-23'),
(1447, 'Male', 'Female', 'Forty is the old age of youth fifty the youth of old age.', 92, '1997-03-22'),
(1448, 'Female', 'Male', 'You can t help getting older, but you don t have to get old.', 90, '1990-06-14'),
(1449, 'Male', 'Female', 'Alas, after a certain age every man is responsible for his face.', 70, '1984-12-05'),
(1450, 'Male', 'Female', 'Youth is when you re allowed to stay up late on New Year s Eve. Middle age is when you re forced to.', 22, '1977-05-06'),
(1451, 'Female', 'Male', 'Old age is like everything else. To make a success of it, you ve got to start young.', 61, '1978-06-28'),
(1452, 'Female', 'Male', 'A comfortable old age is the reward of a well-spent youth. Instead of its bringing sad and melancholy prospects of decay, it would give us hopes of eternal youth in a better world.', 95, '1974-05-05'),
(1453, 'Female', 'Male', 'A man growing old becomes a child again.', 24, '1974-11-27'),
(1454, 'Male', 'Female', 'I will never be an old man. To me, old age is always 15 years older than I am.', 40, '1982-02-25'),
(1455, 'Female', 'Male', 'Age considers youth ventures.', 30, '1973-02-19'),
(1456, 'Male', 'Female', 'What most persons consider as virtue, after the age of 40 is simply a loss of energy.', 65, '1979-06-09'),
(1457, 'Female', 'Male', 'Age is a very high price to pay for maturity.', 75, '1975-04-14'),
(1458, 'Female', 'Male', 'Old age is no place for sissies.', 50, '1981-04-15'),
(1459, 'Female', 'Male', 'I don t feel old. I don t feel anything till noon. That s when it s time for my nap.', 75, '1986-08-24'),
(1460, 'Male', 'Female', 'As I approve of a youth that has something of the old man in him, so I am no less pleased with an old man that has something of the youth. He that follows this rule may be old in body, but can never be so in mind.', 42, '1980-10-03'),
(1461, 'Male', 'Female', 'I don t believe one grows older. I think that what happens early on in life is that at a certain age one stands still and stagnates.', 49, '1992-12-28'),
(1462, 'Male', 'Female', 'Advice in old age is foolish for what can be more absurd than to increase our provisions for the road the nearer we approach to our journey s end.', 18, '1987-01-03'),
(1463, 'Male', 'Female', 'When grace is joined with wrinkles, it is adorable. There is an unspeakable dawn in happy old age.', 70, '1979-10-06'),
(1464, 'Female', 'Male', 'It takes a long time to become young.', 82, '1994-04-05'),
(1465, 'Male', 'Female', 'After thirty, a body has a mind of its own.', 21, '1991-06-09'),
(1466, 'Male', 'Female', 'There is a fountain of youth: it is your mind, your talents, the creativity you bring to your life and the lives of people you love. When you learn to tap this source, you will truly have defeated age.', 59, '1995-06-02'),
(1467, 'Female', 'Male', 'Age is not a particularly interesting subject. Anyone can get old. All you have to do is live long enough.', 29, '1978-06-09'),
(1468, 'Male', 'Female', 'Old minds are like old horses you must exercise them if you wish to keep them in working order.', 7, '1981-07-06'),
(1469, 'Female', 'Male', 'Forty is the old age of youth, fifty is the youth of old age.', 83, '1984-02-24'),
(1470, 'Female', 'Male', 'Youth is the gift of nature, but age is a work of art.', 23, '1998-10-18'),
(1471, 'Male', 'Female', 'Preparation for old age should begin not later than one s teens. A life which is empty of purpose until 65 will not suddenly become filled on retirement.', 79, '1979-04-27'),
(1472, 'Male', 'Female', 'There is always some specific moment when we become aware that our youth is gone but, years after, we know it was much later.', 15, '1994-12-10'),
(1473, 'Male', 'Female', 'Growing old is no more than a bad habit which a busy person has no time to form.', 38, '1981-05-14'),
(1474, 'Female', 'Male', 'As long as any adult thinks that he, like the parents and teachers of old, can become introspective, invoking his own youth to understand the youth before him, he is lost.', 28, '1995-02-03'),
(1475, 'Female', 'Male', 'Old age is fifteen years older than I am.', 75, '1994-12-20'),
(1476, 'Female', 'Male', 'Aging is not lost youth but a new stage of opportunity and strength.', 39, '1980-09-23'),
(1477, 'Male', 'Female', 'The great secret that all old people share is that you really haven t changed in seventy or eighty years. Your body changes, but you don t change at all. And that, of course, causes great confusion.', 56, '1981-08-12'),
(1478, 'Female', 'Male', 'The trick is growing up without growing old.', 55, '1989-09-04'),
(1479, 'Male', 'Female', 'Old age comes on suddenly, and not gradually as is thought.', 68, '1985-06-30'),
(1480, 'Female', 'Male', 'I think your whole life shows in your face and you should be proud of that.', 41, '1973-05-08'),
(1481, 'Male', 'Female', 'I m happy to report that my inner child is still ageless.', 2, '1987-09-07'),
(1482, 'Female', 'Male', 'Youth is the best time to be rich, and the best time to be poor.', 82, '1997-01-04'),
(1483, 'Male', 'Female', 'It is sad to grow old but nice to ripen.', 71, '1998-09-25'),
(1484, 'Female', 'Male', 'One of the many things nobody ever tells you about middle age is that it s such a nice change from being young.', 38, '1984-10-24'),
(1485, 'Female', 'Male', 'After you re older, two things are possibly more important than any others: health and money.', 9, '1974-04-01'),
(1486, 'Male', 'Female', 'You end up as you deserve. In old age you must put up with the face, the friends, the health, and the children you have earned.', 50, '1995-04-26'),
(1487, 'Male', 'Female', 'I m not interested in age. People who tell me their age are silly. You re as old as you feel.', 35, '1977-05-28'),
(1488, 'Female', 'Male', 'Inflation is when you pay fifteen dollars for the ten-dollar haircut you used to get for five dollars when you had hair.', 22, '1988-07-11'),
(1489, 'Male', 'Female', 'My notion of a wife at 40 is that a man should be able to change her, like a bank note, for two 20s.', 20, '1977-02-27'),
(1490, 'Male', 'Female', 'As you age naturally, your family shows more and more on your face. If you deny that, you deny your heritage.', 59, '1990-11-13'),
(1491, 'Female', 'Male', 'Old age is like a plane flying through a storm. Once you re aboard, there s nothing you can do.', 72, '1988-04-22'),
(1492, 'Female', 'Male', 'In youth the days are short and the years are long. In old age the years are short and day s long.', 83, '1995-05-22'),
(1493, 'Female', 'Male', 'The aging process has you firmly in its grasp if you never get the urge to throw a snowball.', 37, '1981-07-28'),
(1494, 'Male', 'Female', 'Age is how we determine how valuable you are.', 46, '1989-09-21'),
(1495, 'Male', 'Female', 'Middle age is when your age starts to show around your middle.', 10, '1992-05-09'),
(1496, 'Male', 'Female', 'Aging seems to be the only available way to live a long life.', 9, '1976-05-13'),
(1497, 'Female', 'Male', 'I think when the full horror of being fifty hits you, you should stay home and have a good cry.', 51, '1988-06-05'),
(1498, 'Male', 'Female', 'To keep the heart unwrinkled, to be hopeful, kindly, cheerful, reverent that is to triumph over old age.', 7, '1992-04-01'),
(1499, 'Male', 'Female', 'If you re old, don t try to change yourself, change your environment.', 4, '1980-04-10'),
(1500, 'Female', 'Male', 'Old age is an excellent time for outrage. My goal is to say or do at least one outrageous thing every week.', 66, '1975-09-08'),
(1501, 'Female', 'Male', 'I want to get old gracefully. I want to have good posture, I want to be healthy and be an example to my children.', 41, '1995-03-02'),
(1502, 'Male', 'Female', 'You know you re getting old when all the names in your black book have M. D. after them.', 86, '1993-11-08'),
(1503, 'Female', 'Male', 'What makes old age so sad is not that our joys but our hopes cease.', 35, '1986-09-12'),
(1504, 'Male', 'Female', 'Old age is a shipwreck.', 66, '1978-12-21'),
(1505, 'Female', 'Male', 'While one finds company in himself and his pursuits, he cannot feel old, no matter what his years may be.', 91, '1978-01-30'),
(1506, 'Female', 'Male', 'To resist the frigidity of old age, one must combine the body, the mind, and the heart. And to keep these in parallel vigor one must exercise, study, and love.', 44, '1974-08-14'),
(1507, 'Male', 'Female', 'Old age is the most unexpected of all the things that can happen to a man.', 91, '1986-05-08'),
(1508, 'Female', 'Male', 'No one can avoid aging, but aging productively is something else.', 54, '1993-02-05'),
(1509, 'Male', 'Female', 'If you haven t turned rebel by twenty you ve got no heart if you haven t turned establishment by thirty you ve got no brains!', 75, '1986-12-11'),
(1510, 'Female', 'Male', 'Oh rage! Oh despair! Oh age, my enemy!', 34, '1998-04-30'),
(1511, 'Male', 'Female', 'I don t want to fight aging I want to take good care of myself, but plastic surgery and all that? I m not interested.', 63, '1998-06-08'),
(1512, 'Female', 'Male', 'Middle age is the time when a man is always thinking that in a week or two he will feel as good as ever.', 26, '1987-01-05'),
(1513, 'Female', 'Male', 'We should so provide for old age that it may have no urgent wants of this world to absorb it from meditation on the next. It is awful to see the lean hands of dotage making a coffer of the grave.', 30, '1988-04-04'),
(1514, 'Male', 'Female', 'Middle age is the awkward period when Father Time starts catching up with Mother Nature.', 59, '1973-07-29'),
(1515, 'Male', 'Female', 'Middle age is youth without levity, and age without decay.', 36, '1991-11-28'),
(1516, 'Male', 'Female', 'No man is ever old enough to know better.', 95, '1976-03-18'),
(1517, 'Female', 'Male', 'The denunciation of the young is a necessary part of the hygiene of older people, and greatly assists the circulation of the blood.', 75, '1989-12-07'),
(1518, 'Female', 'Male', 'In youth we run into difficulties. In old age difficulties run into us.', 59, '1984-08-30'),
(1519, 'Female', 'Male', 'We pay when old for the excesses of youth.', 73, '1990-12-18'),
(1520, 'Male', 'Female', 'The answer to old age is to keep one s mind busy and to go on with one s life as if it were interminable. I always admired Chekhov for building a new house when he was dying of tuberculosis.', 11, '1999-07-22'),
(1521, 'Male', 'Female', 'We ve put more effort into helping folks reach old age than into helping them enjoy it.', 59, '1977-08-23'),
(1522, 'Female', 'Male', 'The real sadness of fifty is not that you change so much but that you change so little.', 52, '1986-01-01'),
(1523, 'Male', 'Female', 'I m not afraid of aging.', 26, '1983-02-02'),
(1524, 'Male', 'Female', 'He has a profound respect for old age. Especially when it s bottled.', 33, '1983-07-06'),
(1525, 'Female', 'Male', 'Whatever poet, orator or sage may say of it, old age is still old age.', 98, '1987-07-09'),
(1526, 'Female', 'Male', 'To keep the heart unwrinkled, to be hopeful, kindly, cheerful, reverent - that is to triumph over old age.', 32, '1989-12-09'),
(1527, 'Female', 'Male', 'In old age we are like a batch of letters that someone has sent. We are no longer in the past, we have arrived.', 35, '1986-01-14'),
(1528, 'Male', 'Female', 'There s no such thing as old age, there is only sorrow.', 4, '1998-12-12'),
(1529, 'Male', 'Female', 'Those who love deeply never grow old they may die of old age, but they die young.', 93, '1980-12-16'),
(1530, 'Male', 'Female', 'I get all fired up about aging in America.', 27, '1978-05-11'),
(1531, 'Female', 'Male', 'The really frightening thing about middle age is the knowledge that you ll grow out of it.', 56, '1975-08-04'),
(1532, 'Male', 'Female', 'There is an anti-aging possibility, but it has to come from within.', 98, '1997-06-02'),
(1533, 'Male', 'Female', 'The lovely thing about being forty is that you can appreciate twenty-five-year-old men more.', 98, '1983-10-01'),
(1534, 'Female', 'Male', 'When a noble life has prepared old age, it is not decline that it reveals, but the first days of immortality.', 39, '1997-06-17'),
(1535, 'Male', 'Female', 'The whole business of marshaling one s energies becomes more and more important as one grows older.', 56, '1975-02-25'),
(1536, 'Female', 'Male', 'The tendency of old age to the body, say the physiologists, is to form bone. It is as rare as it is pleasant to meet with an old man whose opinions are not ossified.', 43, '1982-03-19'),
(1537, 'Male', 'Female', 'Old age adds to the respect due to virtue, but it takes nothing from the contempt inspired by vice it whitens only the hair.', 32, '1979-10-19'),
(1538, 'Female', 'Male', 'As men get older, the toys get more expensive.', 97, '1974-03-26'),
(1539, 'Male', 'Female', 'I find that a man is as old as his work. If his work keeps him from moving forward, he will look forward with the work.', 90, '1974-11-03'),
(1540, 'Female', 'Male', 'Common sense is the collection of prejudices acquired by age eighteen.', 85, '1975-09-03'),
(1541, 'Male', 'Female', 'Reading, after a certain age, diverts the mind too much from its creative pursuits. Any man who reads too much and uses his own brain too little falls into lazy habits of thinking.', 30, '1986-12-26'),
(1542, 'Female', 'Male', 'Confusion of goals and perfection of means seems, in my opinion, to characterize our age.', 87, '1974-07-07'),
(1543, 'Male', 'Female', 'Perfection of means and confusion of ends seem to characterize our age.', 16, '1988-01-03'),
(1544, 'Male', 'Female', 'The age of a woman doesn t mean a thing. The best tunes are played on the oldest fiddles.', 60, '1980-06-13'),
(1545, 'Male', 'Female', 'Life would be infinitely happier if we could only be born at the age of eighty and gradually approach eighteen.', 64, '1996-03-21'),
(1546, 'Male', 'Female', 'A stockbroker urged me to buy a stock that would triple its value every year. I told him,  At my age, I don t even buy green bananas. ', 74, '1989-06-27'),
(1547, 'Female', 'Male', 'When marrying, ask yourself this question: Do you believe that you will be able to converse well with this person into your old age? Everything else in marriage is transitory.', 67, '1983-08-28'),
(1548, 'Male', 'Female', 'Probably the happiest period in life most frequently is in middle age, when the eager passions of youth are cooled, and the infirmities of age not yet begun as we see that the shadows, which are at morning and evening so large, almost entirely disappear at midday.', 45, '1982-01-29'),
(1549, 'Female', 'Male', 'Age is whatever you think it is. You are as old as you think you are.', 51, '1981-04-05'),
(1550, 'Female', 'Male', 'As human beings, our greatness lies not so much in being able to remake the world - that is the myth of the atomic age - as in being able to remake ourselves.', 91, '1988-03-03'),
(1551, 'Male', 'Female', 'A man loves the meat in his youth that he cannot endure in his age.', 45, '1999-10-02'),
(1552, 'Male', 'Female', 'In every country and every age, the priest had been hostile to Liberty.', 15, '1989-05-23'),
(1553, 'Male', 'Female', 'The heresy of one age becomes the orthodoxy of the next.', 13, '1985-04-11'),
(1554, 'Male', 'Female', 'The golden age is before us, not behind us.', 13, '1978-04-11'),
(1555, 'Female', 'Male', 'Every formula of every religion has in this age of reason, to submit to the acid test of reason and universal assent.', 61, '1996-09-04'),
(1556, 'Male', 'Female', 'Thomas Jefferson once said,  We should never judge a president by his age, only by his works.  And ever since he told me that, I stopped worrying.', 37, '1987-03-03'),
(1557, 'Female', 'Male', 'No woman should ever be quite accurate about her age. It looks so calculating.', 67, '1992-01-28'),
(1558, 'Male', 'Female', 'At twenty years of age the will reigns at thirty, the wit and at forty, the judgment.', 38, '1981-07-25'),
(1559, 'Female', 'Male', 'Age does not protect you from love. But love, to some extent, protects you from age.', 25, '1994-01-06'),
(1560, 'Female', 'Male', 'Information is the oxygen of the modern age. It seeps through the walls topped by barbed wire, it wafts across the electrified borders.', 67, '1986-09-22'),
(1561, 'Female', 'Male', 'Old age is just a record of one s whole life.', 55, '1977-09-04'),
(1562, 'Male', 'Female', 'We prefer world law in the age of self-determination to world war in the age of mass extermination.', 81, '1986-11-12'),
(1563, 'Female', 'Male', 'Each age, it is found, must write its own books or rather, each generation for the next succeeding.', 36, '1995-04-02'),
(1564, 'Male', 'Female', 'Education is the best provision for old age.', 40, '1984-01-05'),
(1565, 'Male', 'Female', 'The secret of staying young is to live honestly, eat slowly, and lie about your age.', 42, '1985-04-15'),
(1566, 'Female', 'Male', 'Sometimes I think it would be easier to avoid old age, to die young, but then you d never complete your life, would you? You d never wholly know you.', 67, '1987-11-21'),
(1567, 'Female', 'Male', 'I don t think of myself as a poor deprived ghetto girl who made good. I think of myself as somebody who from an early age knew I was responsible for myself, and I had to make good.', 13, '1991-04-02'),
(1568, 'Female', 'Male', 'The kids are old enough now - I just want to let them be kids. I don t want to comment on them too much. They re at an age where I just want to let them be kids.', 13, '1982-08-05'),
(1569, 'Female', 'Male', 'He who is of calm and happy nature will hardly feel the pressure of age, but to him who is of an opposite disposition youth and age are equally a burden.', 70, '1985-08-06'),
(1570, 'Male', 'Female', 'Why should society feel responsible only for the education of children, and not for the education of all adults of every age?', 58, '1980-07-04'),
(1571, 'Male', 'Female', 'I ve got volumes on how not to behave. I ve got more information now than a guy should have at my age.', 50, '1987-02-18'),
(1572, 'Male', 'Female', 'I m at the age where food has taken the place of sex in my life. In fact, I ve just had a mirror put over my kitchen table.', 98, '1997-01-28'),
(1573, 'Female', 'Male', 'Age is something that doesn t matter, unless you are a cheese.', 56, '1976-04-05'),
(1574, 'Male', 'Female', 'Hesitation increases in relation to risk in equal proportion to age.', 42, '1983-01-11'),
(1575, 'Female', 'Male', 'Books were my pass to personal freedom. I learned to read at age three, and soon discovered there was a whole world to conquer that went beyond our farm in Mississippi.', 97, '1998-05-13'),
(1576, 'Female', 'Male', 'In our age there is no such thing as  keeping out of politics.  All issues are political issues, and politics itself is a mass of lies, evasions, folly, hatred and schizophrenia.', 59, '1997-02-04'),
(1577, 'Female', 'Male', 'I must confess, I was born at a very early age.', 4, '1982-03-22'),
(1578, 'Female', 'Male', 'The secret of genius is to carry the spirit of the child into old age, which mean never losing your enthusiasm.', 52, '1981-04-01'),
(1579, 'Male', 'Female', 'It is utterly false and cruelly arbitrary to put all the play and learning into childhood, all the work into middle age, and all the regrets into old age.', 5, '1988-12-11'),
(1580, 'Female', 'Male', 'We aren t in an information age, we are in an entertainment age.', 52, '1975-01-03'),
(1581, 'Male', 'Female', 'To me - old age is always ten years older than I am.', 96, '1973-03-27'),
(1582, 'Male', 'Female', 'Age is not important unless you re a cheese.', 67, '1987-04-23'),
(1583, 'Female', 'Male', 'No matter what age you are, or what your circumstances might be, you are special, and you still have something unique to offer. Your life, because of who you are, has meaning.', 75, '1987-05-19'),
(1584, 'Male', 'Female', 'A woman has the age she deserves.', 19, '1984-01-12'),
(1585, 'Female', 'Male', 'The older I grow the more I distrust the familiar doctrine that age brings wisdom.', 42, '1976-02-01'),
(1586, 'Male', 'Female', 'Youngsters of the age of two and three are endowed with extraordinary strength. They can lift a dog twice their own weight and dump him into the bathtub.', 38, '1991-03-24'),
(1587, 'Female', 'Male', 'He who has not the spirit of this age, has all the misery of it.', 56, '1982-08-12'),
(1588, 'Male', 'Female', 'Instead of being presented with stereotypes by age, sex, color, class, or religion, children must have the opportunity to learn that within each range, some people are loathsome and some are delightful.', 95, '1995-02-21'),
(1589, 'Female', 'Male', 'I think being able to age gracefully is a very important talent. It is too late for me.', 11, '1973-12-13'),
(1590, 'Female', 'Male', 'Error is acceptable as long as we are young but one must not drag it along into old age.', 0, '1980-06-23'),
(1591, 'Female', 'Male', 'Age wrinkles the body. Quitting wrinkles the soul.', 70, '1999-08-25'),
(1592, 'Female', 'Male', 'I don t need you to remind me of my age. I have a bladder to do that for me.', 57, '1999-02-09'),
(1593, 'Female', 'Male', 'Talk is by far the most accessible of pleasures. It costs nothing in money, it is all profit, it completes our education, founds and fosters our friendships, and can be enjoyed at any age and in almost any state of health.', 52, '1997-08-20'),
(1594, 'Female', 'Male', 'Men of age object too much, consult too long, adventure too little, repent too soon, and seldom drive business home to the full period, but content themselves with a mediocrity of success.', 32, '1994-05-18'),
(1595, 'Male', 'Female', 'Better pass boldly into that other world, in the full glory of some passion, than fade and wither dismally with age.', 6, '1979-03-18'),
(1596, 'Female', 'Male', 'Age merely shows what children we remain.', 52, '1975-03-13'),
(1597, 'Female', 'Male', 'Each moment of a happy lover s hour is worth an age of dull and common life.', 54, '1989-05-16'),
(1598, 'Female', 'Male', 'The credit of advancing science has always been due to individuals and never to the age.', 46, '1993-02-25'),
(1599, 'Male', 'Female', 'Dressing up is a bore. At a certain age, you decorate yourself to attract the opposite sex, and at a certain age, I did that. But I m past that age.', 49, '1978-03-02'),
(1600, 'Male', 'Female', 'I was born at the age of twelve on an MGM lot.', 8, '1986-08-08'),
(1601, 'Male', 'Female', 'A woman telling her true age is like a buyer confiding his final price to an Armenian rug dealer.', 12, '1988-10-15'),
(1602, 'Female', 'Male', 'How young can you die of old age?', 48, '1991-04-23'),
(1603, 'Male', 'Female', 'Legend: A lie that has attained the dignity of age.', 64, '1995-03-16'),
(1604, 'Female', 'Male', 'Age does not protect you from love. But love, to some extent, protects you from age.', 48, '1987-08-19'),
(1605, 'Male', 'Female', 'Every great architect is - necessarily - a great poet. He must be a great original interpreter of his time, his day, his age.', 14, '1977-03-06'),
(1606, 'Female', 'Male', 'At the age of six I wanted to be a cook. At seven I wanted to be Napoleon. And my ambition has been growing steadily ever since.', 44, '1996-09-29'),
(1607, 'Female', 'Male', 'Middle age is when you re sitting at home on a Saturday night and the telephone rings and you hope it isn t for you.', 17, '1984-04-14'),
(1608, 'Male', 'Female', 'If youth knew if age could.', 55, '1988-10-30'),
(1609, 'Female', 'Male', 'I think the biggest disease the world suffers from in this day and age is the disease of people feeling unloved. I know that I can give love for a minute, for half an hour, for a day, for a month, but I can give. I am very happy to do that, I want to do that.', 38, '1973-11-25'),
(1610, 'Female', 'Male', 'The charm of history and its enigmatic lesson consist in the fact that, from age to age, nothing changes and yet everything is completely different.', 12, '1982-09-28'),
(1611, 'Male', 'Female', 'Men are like wine - some turn to vinegar, but the best improve with age.', 44, '1987-10-18'),
(1612, 'Female', 'Male', 'I created Punk for this day and age. Do you see Britney walking around wearing ties and singing punk? Hell no. That s what I do. I m like a Sid Vicious for a new generation.', 44, '1990-06-03'),
(1613, 'Male', 'Female', 'We are all geniuses up to the age of ten.', 90, '1985-03-01'),
(1614, 'Male', 'Female', 'It is well for the world that in most of us, by the age of thirty, the character has set like plaster, and will never soften again.', 89, '1993-01-19'),
(1615, 'Male', 'Female', 'Every age has its own poetry in every age the circumstances of history choose a nation, a race, a class to take up the torch by creating situations that can be expressed or transcended only through poetry.', 74, '1996-01-25'),
(1616, 'Male', 'Female', 'Old age is not a matter for sorrow. It is matter for thanks if we have left our work done behind us.', 37, '1975-02-04'),
(1617, 'Male', 'Female', 'I suppose when they reach a certain age some men are afraid to grow up. It seems the older the men get, the younger their new wives get.', 14, '1985-03-17'),
(1618, 'Male', 'Female', 'Sex at age 90 is like trying to shoot pool with a rope.', 30, '1991-04-20'),
(1619, 'Male', 'Female', 'Publishing is in a kind of Jurassic age.', 21, '1977-10-23'),
(1620, 'Male', 'Female', 'Age is just a number. It s totally irrelevant unless, of course, you happen to be a bottle of wine.', 46, '1988-09-19'),
(1621, 'Male', 'Female', 'Whatever you may look like, marry a man your own age - as your beauty fades, so will his eyesight.', 67, '1975-04-19'),
(1622, 'Male', 'Female', 'Youth has no age.', 27, '1995-01-12'),
(1623, 'Male', 'Female', 'Youth is a blunder Manhood a struggle, Old Age a regret.', 79, '1992-04-24'),
(1624, 'Male', 'Female', 'To teach how to live without certainty and yet without being paralysed by hesitation is perhaps the chief thing that philosophy, in our age, can do for those who study it.', 22, '1979-03-03'),
(1625, 'Male', 'Female', 'It is possible that mankind is on the threshold of a golden age but, if so, it will be necessary first to slay the dragon that guards the door, and this dragon is religion.', 32, '1995-06-22'),
(1626, 'Female', 'Male', 'Nobody expects to trust his body overmuch after the age of fifty.', 34, '1986-11-09'),
(1627, 'Male', 'Female', 'Old age realizes the dreams of youth: look at Dean Swift in his youth he built an asylum for the insane, in his old age he was himself an inmate.', 82, '1983-06-14'),
(1628, 'Female', 'Male', 'In youth we learn in age we understand.', 6, '1983-08-16'),
(1629, 'Female', 'Male', 'Believe me, that was a happy age, before the days of architects, before the days of builders.', 6, '1973-03-08'),
(1630, 'Male', 'Female', 'I have the problems of, I must confess, old age.', 36, '1980-02-09'),
(1631, 'Male', 'Female', 'Not just in commerce but in the world of ideas too our age is putting on a veritable clearance sale. Everything can be had so dirt cheap that one begins to wonder whether in the end anyone will want to make a bid.', 61, '1978-09-28'),
(1632, 'Female', 'Male', 'Bad news isn t wine. It doesn t improve with age.', 65, '1980-08-22'),
(1633, 'Male', 'Female', 'It were a real increase of human happiness, could all young men from the age of nineteen be covered under barrels, or rendered otherwise invisible and there left to follow their lawful studies and callings, till they emerged, sadder and wiser, at the age of twenty-five.', 28, '1987-04-13'),
(1634, 'Female', 'Male', 'People who refuse to rest honorably on their laurels when they reach retirement age seem very admirable to me.', 54, '1985-08-20'),
(1635, 'Male', 'Female', 'Not to expose your true feelings to an adult seems to be instinctive from the age of seven or eight onwards.', 41, '1980-06-25'),
(1636, 'Male', 'Female', 'The heart never grows better by age I fear rather worse, always harder. A young liar will be an old one, and a young knave will only be a greater knave as he grows older.', 80, '1976-11-27'),
(1637, 'Male', 'Female', 'For age is opportunity no less Than youth itself, though in another dress, And as the evening twilight fades away The sky is filled with stars, invisible by day.', 33, '1981-04-21'),
(1638, 'Female', 'Male', 'Age is a case of mind over matter. If you don t mind, it don t matter.', 72, '1973-08-24'),
(1639, 'Male', 'Female', 'Have regular hours for work and play make each day both useful and pleasant, and prove that you understand the worth of time by employing it well. Then youth will be delightful, old age will bring few regrets, and life will become a beautiful success.', 46, '1980-10-18'),
(1640, 'Female', 'Male', 'Admiration of the proletariat, like that of dams, power stations, and aeroplanes, is part of the ideology of the machine age.', 54, '1978-09-17'),
(1641, 'Female', 'Male', 'But the age of chivalry is gone. That of sophisters, economists, and calculators has succeeded and the glory of Europe is extinguished forever.', 80, '1996-12-06'),
(1642, 'Female', 'Male', 'Childhood: the period of human life intermediate between the idiocy of infancy and the folly of youth - two removes from the sin of manhood and three from the remorse of age.', 79, '1988-01-10'),
(1643, 'Female', 'Male', 'Experience is a revelation in the light of which we renounce our errors of youth for those of age.', 89, '1988-10-01'),
(1644, 'Female', 'Male', 'My view is that at a younger age your optimism is more and you have more imagination etc. You have less bias.', 15, '1972-11-24'),
(1645, 'Female', 'Male', 'The ruling ideas of each age have ever been the ideas of its ruling class.', 28, '1992-06-27'),
(1646, 'Female', 'Male', 'In the information age, you don t teach philosophy as they did after feudalism. You perform it. If Aristotle were alive today he d have a talk show.', 61, '1974-12-07'),
(1647, 'Female', 'Male', 'Once I planned to write a book of poems entirely about the things in my pocket. But I found it would be too long and the age of the great epics is past.', 18, '1996-07-25'),
(1648, 'Male', 'Female', 'The harvest of old age is the recollection and abundance of blessing previously secured.', 71, '1979-01-14'),
(1649, 'Female', 'Male', 'It is the spirit of the age to believe that any fact, no matter how suspect, is superior to any imaginative exercise, no matter how true.', 81, '1985-03-20'),
(1650, 'Female', 'Male', 'The arrogance of age must submit to be taught by youth.', 17, '1974-08-18'),
(1651, 'Female', 'Male', 'The biggest disease this day and age is that of people feeling unloved.', 14, '1983-07-16'),
(1652, 'Male', 'Female', 'Old age: the crown of life, our play s last act.', 71, '1984-08-26'),
(1653, 'Female', 'Male', 'I think women should start to embrace their age. What s the alternative to getting older? You die. I can t change the day I was born. But I can take care of my skin, my body, my mind, and try to live my life and be happy.', 8, '1982-10-29'),
(1654, 'Female', 'Male', 'Age is getting to know all the ways the world turns, so that if you cannot turn the world the way you want, you can at least get out of the way so you won t get run over.', 27, '1974-02-12'),
(1655, 'Male', 'Female', 'Few women, I fear, have had such reason as I have to think the long sad years of youth were worth living for the sake of middle age.', 25, '1979-12-05'),
(1656, 'Male', 'Female', 'One crowded hour of glorious life is worth an age without a name.', 64, '1974-04-25'),
(1657, 'Male', 'Female', 'Wives are young men s mistresses, companions for middle age, and old men s nurses.', 9, '1975-09-05'),
(1658, 'Female', 'Male', 'Wisdom doesn t necessarily come with age. Sometimes age just shows up all by itself.', 66, '1995-04-03'),
(1659, 'Male', 'Female', 'It is a blessed thing that in every age some one has had the individuality enough and courage enough to stand by his own convictions.', 3, '1975-06-25'),
(1660, 'Female', 'Male', 'And in my own life, in my own small way, I ve tried to give back to this country that has given me so much. That s why I left a job at a law firm for a career in public service, working to empower young people to volunteer in their communities. Because I believe that each of us - no matter what our age or background or walk of life - each of us has something to contribute to the life of this nation.', 98, '1976-06-07'),
(1661, 'Male', 'Female', 'No lying knight or lying priest ever prospered in any age, but especially not in the dark ones. Men prospered then only in following an openly declared purpose, and preaching candidly beloved and trusted creeds.', 78, '1988-02-08'),
(1662, 'Female', 'Male', 'A man does not die of love or his liver or even of old age he dies of being a man.', 17, '1977-03-26'),
(1663, 'Male', 'Female', 'It is with an old love as it is with old age a man lives to all the miseries, but is dead to all the pleasures.', 85, '1998-01-21'),
(1664, 'Female', 'Male', 'I cried on my 18th birthday. I thought 17 was such a nice age. You re young enough to get away with things, but you re old enough, too.', 97, '1997-11-27'),
(1665, 'Female', 'Male', 'We live in an age when to be young and to be indifferent can be no longer synonymous. We must prepare for the coming hour. The claims of the Future are represented by suffering millions and the Youth of a Nation are the trustees of Posterity.', 56, '1999-03-31'),
(1666, 'Female', 'Male', 'Age shouldn t affect you. It s just like the size of your shoes - they don t determine how you live your life! You re either marvellous or you re boring, regardless of your age.', 59, '1999-08-19'),
(1667, 'Female', 'Male', 'Rashness belongs to youth prudence to old age.', 24, '1972-12-14'),
(1668, 'Female', 'Male', 'Many believe - and I believe - that I have been designated for this work by God. In spite of my old age, I do not want to give it up I work out of love for God and I put all my hope in Him.', 48, '1998-04-30'),
(1669, 'Female', 'Male', 'Old age is a tyrant, who forbids, under pain of death, the pleasures of youth.', 96, '1990-01-03'),
(1670, 'Female', 'Male', 'The defects of the mind, like those of the face, grow worse with age.', 73, '1984-04-21'),
(1671, 'Male', 'Female', 'The enemy of society is middle class and the enemy of life is middle age.', 70, '1995-07-22'),
(1672, 'Female', 'Male', 'Some say that the age of chivalry is past, that the spirit of romance is dead. The age of chivalry is never past, so long as there is a wrong left unredressed on earth.', 6, '1973-12-17'),
(1673, 'Male', 'Female', 'Man has no Body distinct from his Soul for that called Body is a portion of Soul discerned by the five Senses, the chief inlets of Soul in this age.', 16, '1983-03-09'),
(1674, 'Female', 'Male', 'Do you remember when you were 10 or 11 years old and you really thought your folks were the best? They were completely omniscient and you took their word for everything. And then you got older and you went through this hideous age when suddenly they were the devil, they were bullies, and they didn t know anything.', 25, '1975-10-10'),
(1675, 'Female', 'Male', 'This is the patent age of new inventions for killing bodies, and for saving souls. All propagated with the best intentions.', 37, '1977-04-25'),
(1676, 'Male', 'Female', 'The mind that is wise mourns less for what age takes away than what it leaves behind.', 52, '1978-06-15'),
(1677, 'Female', 'Male', 'The age of chivalry is past. Bores have succeeded to dragons.', 59, '1987-10-07'),
(1678, 'Male', 'Female', 'Anything you cannot relinquish when it has outlived its usefulness possesses you, and in this materialistic age a great many of us are possessed by our possessions.', 29, '1995-06-22'),
(1679, 'Male', 'Female', 'Like many women my age, I am 28 years old.', 59, '1981-10-19'),
(1680, 'Female', 'Male', 'Life, an age to the miserable, and a moment to the happy.', 91, '1978-11-13'),
(1681, 'Male', 'Female', 'We are always the same age inside.', 96, '1985-08-28'),
(1682, 'Male', 'Female', 'I am, as I ve said, merely competent. But in an age of incompetence, that makes me extraordinary.', 98, '1982-01-31'),
(1683, 'Female', 'Male', 'Swing voters are more appropriately known as the  idiot voters  because they have no set of philosophical principles. By the age of fourteen, you re either a Conservative or a Liberal if you have an IQ above a toaster.', 76, '1997-10-29'),
(1684, 'Male', 'Female', 'If you live to be one hundred, you ve got it made. Very few people die past that age.', 31, '1974-11-01'),
(1685, 'Male', 'Female', 'Old age is far more than white hair, wrinkles, the feeling that it is too late and the game finished, that the stage belongs to the rising generations. The true evil is not the weakening of the body, but the indifference of the soul.', 23, '1990-06-13'),
(1686, 'Female', 'Male', 'Old age has its pleasures, which, though different, are not less than the pleasures of youth.', 48, '1984-08-29'),
(1687, 'Male', 'Female', 'Old age is when the liver spots show through your gloves.', 2, '1989-01-25'),
(1688, 'Male', 'Female', 'There is no absurdity so palpable but that it may be firmly planted in the human head if you only begin to inculcate it before the age of five, by constantly repeating it with an air of great solemnity.', 31, '1994-11-26'),
(1689, 'Female', 'Male', 'Those who improve with age embrace the power of personal growth and personal achievement and begin to replace youth with wisdom, innocence with understanding, and lack of purpose with self-actualization.', 33, '1998-08-22'),
(1690, 'Male', 'Female', 'Nearly all the powerful people of this age are unbelievers, the best of them in doubt and misery, the most in plodding hesitation, doing as well as they can, what practical work lies at hand.', 81, '1980-04-05'),
(1691, 'Male', 'Female', 'What is an adult? A child blown up by age.', 21, '1982-04-19'),
(1692, 'Female', 'Male', 'Intelligent life on a planet comes of age when it first works out the reason for its own existence.', 94, '1978-05-18'),
(1693, 'Male', 'Female', 'I am of a healthy long lived race, and our minds improve with age.', 5, '1976-04-04'),
(1694, 'Female', 'Male', 'The wisdom of age: don t stop walking.', 43, '1975-01-07'),
(1695, 'Female', 'Male', 'As the age of television progresses the Reagans will be the rule, not the exception. To be perfect for television is all a President has to be these days.', 23, '1982-12-26'),
(1696, 'Male', 'Female', 'Before anything else, we need a new age of Enlightenment. Our present political systems must relinquish their claims on truth, justice and freedom and have to replace them with the search for truth, justice, freedom and reason.', 80, '1977-08-31'),
(1697, 'Male', 'Female', 'Age is strictly a case of mind over matter. If you don t mind, it doesn t matter.', 20, '1985-12-03'),
(1698, 'Female', 'Male', 'Age  is the acceptance of a term of years. But maturity is the glory of years.', 96, '1992-08-16'),
(1699, 'Female', 'Male', 'I think we ought to raise the age at which juveniles can have a gun.', 41, '1974-04-24'),
(1700, 'Female', 'Male', 'In this age, which believes that there is a short cut to everything, the greatest lesson to be learned is that the most difficult way is, in the long run, the easiest.', 60, '1991-09-19'),
(1701, 'Female', 'Male', 'A man is a fool if he drinks before he reaches the age of 50, and a fool if he doesn t afterward.', 33, '1980-02-03'),
(1702, 'Male', 'Female', 'There are few things that we so unwillingly give up, even in advanced age, as the supposition that we still have the power of ingratiating ourselves with the fair sex.', 18, '1988-05-16'),
(1703, 'Male', 'Female', 'Age imprints more wrinkles in the mind than it does on the face.', 68, '1986-06-26'),
(1704, 'Male', 'Female', 'I was confirmed at my prep school at the age of 13.', 2, '1984-11-04'),
(1705, 'Female', 'Male', 'Love has no age, no limit and no death.', 80, '1986-03-06'),
(1706, 'Female', 'Male', 'What makes old age hard to bear is not the failing of one s faculties, mental and physical, but the burden of one s memories.', 26, '1978-09-17'),
(1707, 'Male', 'Female', 'I have always paid income tax. I object only when it reaches a stage when I am threatened with having nothing left for my old age - which is due to start next Tuesday or Wednesday.', 77, '1972-12-21'),
(1708, 'Male', 'Female', 'In my youth I stressed freedom, and in my old age I stress order. I have made the great discovery that liberty is a product of order.', 88, '1978-09-04'),
(1709, 'Female', 'Male', 'And I m afraid, in this day and age, trust, which I count so, you know, I love loyalty. I love trust.', 44, '1989-05-18'),
(1710, 'Female', 'Male', 'My dad encouraged us to fail. Growing up, he would ask us what we failed at that week. If we didn t have something, he would be disappointed. It changed my mindset at an early age that failure is not the outcome, failure is not trying. Don t be afraid to fail.', 45, '1999-10-24'),
(1711, 'Female', 'Male', 'What is the worst of woes that wait on age? What stamps the wrinkle deeper on the brow? To view each loved one blotted from life s page, And be alone on earth, as I am now.', 59, '1982-11-23'),
(1712, 'Female', 'Male', 'Age is a matter of feeling, not of years.', 38, '1982-08-01'),
(1713, 'Female', 'Male', 'A tart temper never mellows with age, and a sharp tongue is the only edged tool that grows keener with constant use.', 41, '1986-07-20'),
(1714, 'Male', 'Female', 'Canada has a passive-aggressive culture, with a lot of sarcasm and righteousness. That went with my weird messianic complex. The ego is a fascinating monster. I was taught from a young age that I had to serve, so that turned into me thinking I had to save the planet.', 17, '1997-07-17'),
(1715, 'Female', 'Male', 'Discrimination due to age is one of the great tragedies of modern life. The desire to work and be useful is what makes life worth living, and to be told your efforts are not needed because you are the wrong age is a crime.', 92, '1991-11-25'),
(1716, 'Female', 'Male', 'An artist must be a reactionary. He has to stand out against the tenor of the age and not go flopping along.', 26, '1986-03-01'),
(1717, 'Male', 'Female', 'What turns me on about the digital age, what excited me personally, is that you have closed the gap between dreaming and doing. You see, it used to be that if you wanted to make a record of a song, you needed a studio and a producer. Now, you need a laptop.', 37, '1992-10-26'),
(1718, 'Male', 'Female', 'I have always felt that a woman has the right to treat the subject of her age with ambiguity until, perhaps, she passes into the realm of over ninety. Then it is better she be candid with herself and with the world.', 58, '1977-07-24'),
(1719, 'Male', 'Female', 'Nice to be here? At my age it s nice to be anywhere.', 19, '1984-06-09'),
(1720, 'Male', 'Female', 'Though the Jazz Age continued it became less and less an affair of youth. The sequel was like a children s party taken over by the elders.', 19, '1994-03-10'),
(1721, 'Female', 'Male', 'Each age has deemed the new-born year the fittest time for festal cheer.', 79, '1983-06-03'),
(1722, 'Male', 'Female', 'Our age knows nothing but reaction, and leaps from one extreme to another.', 81, '1978-11-08'),
(1723, 'Male', 'Female', 'The philosophies of one age have become the absurdities of the next, and the foolishness of yesterday has become the wisdom of tomorrow.', 22, '1982-04-21'),
(1724, 'Female', 'Male', 'I saw no African people in the printed and illustrated Sunday school lessons. I began to suspect at this early age that someone had distorted the image of my people. My long search for the true history of African people the world over began.', 91, '1993-09-26'),
(1725, 'Female', 'Male', 'In order to fix Social Security, we must restructure it so that we continue to provide for our Nation s seniors that are approaching retirement age, but allow for younger taxpayers to invest a portion of their Social Security taxes in private accounts.', 40, '1979-09-02'),
(1726, 'Male', 'Female', 'No lie ever reaches old age.', 17, '1979-06-24'),
(1727, 'Male', 'Female', 'I wanted to be a teacher. I love children, so I wanted to deal with children. Then I wanted to be a veterinarian. But by the age of ten or eleven, when I opened my mouth and said,  Oh, God, what s this?  I kind of knew teaching and being a veterinarian were gonna have to wait.', 83, '1987-05-01'),
(1728, 'Male', 'Female', 'This is the curse of our age, even the strangest aberrations are no cure for boredom.', 79, '1981-09-21'),
(1729, 'Female', 'Male', 'If repression has indeed been the fundamental link between power, knowledge, and sexuality since the classical age, it stands to reason that we will not be able to free ourselves from it except at a considerable cost.', 77, '1996-12-22'),
(1730, 'Male', 'Female', 'But an old age serene and bright, and lovely as a Lapland night, shall lead thee to thy grave.', 36, '1997-06-15'),
(1731, 'Male', 'Female', 'Litigation takes the place of sex at middle age.', 79, '1979-04-16'),
(1732, 'Male', 'Female', 'The face you have at age 25 is the face God gave you, but the face you have after 50 is the face you earned.', 52, '1977-06-06'),
(1733, 'Male', 'Female', 'The hallmark of our age is the tension between aspirations and sluggish institutions.', 46, '1990-12-27'),
(1734, 'Male', 'Female', 'It seems as if an age of genius must be succeeded by an age of endeavour riot and extravagance by cleanliness and hard work.', 92, '1987-12-22'),
(1735, 'Male', 'Female', 'Old age is ready to undertake tasks that youth shirked because they would take too long.', 10, '1978-02-18'),
(1736, 'Male', 'Female', 'A woman tells her doctor,  I ve got a bad back.  The doctor says,  It s old age.  The woman says,  I want a second opinion.  The doctor says:  Okay - you re ugly as well. ', 7, '1991-10-29'),
(1737, 'Female', 'Male', 'I m 36 and if I met a woman of my own age and married her, I d also be marrying her former life, her past. It might be OK for some people - I don t want to judge it or anything - but it s not for me. It would destroy my creativity.', 67, '1984-11-25'),
(1738, 'Male', 'Female', 'I believe we should encourage children to sing and play instruments from an early age.', 58, '1992-01-05'),
(1739, 'Female', 'Male', 'You should not consider a man s age but his acts.', 24, '1990-02-19'),
(1740, 'Female', 'Male', 'At my age flowers scare me.', 80, '1973-02-06'),
(1741, 'Male', 'Female', 'I would go out with women my age, but there are no women my age.', 31, '1976-09-09'),
(1742, 'Male', 'Female', 'It is not well to make great changes in old age.', 65, '1989-06-14'),
(1743, 'Male', 'Female', 'Setting a good example for your children takes all the fun out of middle age.', 45, '1993-11-25'),
(1744, 'Female', 'Male', 'You are 27 or 28 right? It is very tough to live at that age. When nothing is sure. I have sympathy with you.', 57, '1990-05-03'),
(1745, 'Male', 'Female', 'The stars shall fade away, the sun himself Grow dim with age, and nature sink in years, But thou shalt flourish in immortal youth, Unhurt amidst the wars of elements, The wrecks of matter, and the crush of worlds.', 88, '1994-04-29'),
(1746, 'Male', 'Female', 'Young men soon give, and soon forget, affronts old age is slow in both.', 45, '1991-02-26'),
(1747, 'Male', 'Female', 'By all but the pathologically romantic, it is now recognized that this is not the age of the small man.', 78, '1993-08-12'),
(1748, 'Female', 'Male', 'It is not the young people that degenerate they are not spoiled till those of mature age are already sunk into corruption.', 76, '1998-03-03'),
(1749, 'Female', 'Male', 'To be happy, we must be true to nature and carry our age along with us.', 46, '1996-02-18'),
(1750, 'Female', 'Male', 'Youth cannot know how age thinks and feels. But old men are guilty if they forget what it was to be young.', 37, '1979-04-16'),
(1751, 'Male', 'Female', 'It is the malady of our age that the young are so busy teaching us that they have no time left to learn.', 15, '1994-12-01');
INSERT INTO `profil` (`user_id`, `gender`, `orientation`, `bio`, `popularity`, `birthdate`) VALUES
(1752, 'Female', 'Male', 'I m at peace with myself and where I am. In the past, I was always looking to see how everybody else was doing. I wasn t competitive, I was comparative. I just wanted to be where everybody else was. Now I ve gotten to an age when I am not comparing anymore.', 18, '1984-08-14'),
(1753, 'Male', 'Female', 'We of Africa protest that, in this day and age, we should continue to be treated as lesser human beings than other races.', 66, '1975-09-14'),
(1754, 'Male', 'Female', 'Marriage is not about age it s about finding the right person.', 17, '1993-05-20'),
(1755, 'Female', 'Male', 'We have entered an age in which education is not just a luxury permitting some men an advantage over others. It has become a necessity without which a person is defenseless in this complex, industrialized society. We have truly entered the century of the educated man.', 64, '1985-11-12'),
(1756, 'Male', 'Female', 'Old age is the verdict of life.', 5, '1993-10-07'),
(1757, 'Male', 'Female', 'The passions grafted on wounded pride are the most inveterate they are green and vigorous in old age.', 54, '1992-02-16'),
(1758, 'Female', 'Male', 'Every age can be enchanting, provided you live within it.', 96, '1980-11-15'),
(1759, 'Female', 'Male', 'It is unthinkable for a Frenchman to arrive at middle age without having syphilis and the Cross of the Legion of Honor.', 56, '1976-01-29'),
