(1914, 'Male', 'Female', 'In my old age, I ll be in L.A.', 17, '1977-06-17'),
(1915, 'Male', 'Female', 'I shall not grow conservative with age.', 95, '1978-05-26'),
(1916, 'Female', 'Male', 'I first learned that there were black people living in some place called other than the United States in the western hemisphere when I was a very little boy, and my father told me that when he was a boy about my age, he wanted to be an Episcopal priest, because he so admired his priest, a black man from someplace called Haiti.', 11, '1995-01-23'),
(1917, 'Male', 'Female', 'Why should 20-year-olds only be considered sexy? I think we get better with age.', 5, '1986-07-24'),
(1918, 'Female', 'Male', 'I saw how many people were poor and how many kids my age went to school hungry in the morning, which I don t think most of my contemporaries in racially segregated schools in the South thought very much about at the time.', 63, '1976-03-27'),
(1919, 'Female', 'Male', 'When you get to my age life seems little more than one long march to and from the lavatory.', 9, '1988-07-25'),
(1920, 'Male', 'Female', 'I think, if you put a camera in anyone s life and document it daily from the age of 21 to 27, there are going to be things that aren t always pretty.', 52, '1986-03-20'),
(1921, 'Male', 'Female', 'Non-disclosure in the Internet Age is quickly perceived as a breach of trust. Government, corporations and each of us as individuals must recalibrate how we live and share our lives appropriate to the information now available and the expectations of others.', 46, '1984-05-03'),
(1922, 'Male', 'Female', 'Where children are, there is the golden age.', 17, '1975-12-07'),
(1923, 'Male', 'Female', 'Sure I played, did you think I was born at the age of 70 sitting in a dugout trying to manage guys like you?', 24, '1996-08-02'),
(1924, 'Female', 'Male', 'To be free in an age like ours, one must be in a position of authority. That in itself would be enough to make me ambitious.', 15, '1974-04-17'),
(1925, 'Female', 'Male', 'I came to water late. I learned to swim at the age of 20.', 12, '1975-04-10'),
(1926, 'Male', 'Female', 'People are so busy dreaming the American Dream, fantasizing about what they could be or have a right to be, that they re all asleep at the switch. Consequently we are living in the Age of Human Error.', 75, '1991-06-12'),
(1927, 'Male', 'Female', 'I was getting hot flashes and sweats on a regular basis. That s not normal, even for my age.', 13, '1992-08-24'),
(1928, 'Male', 'Female', 'I remember at the age of five travelling on a trolley car with my mother past a group of women on a picket line at a textile plant, seeing them being viciously beaten by security people. So that kind of thing stayed with me.', 80, '1997-08-08'),
(1929, 'Male', 'Female', 'Age is not all decay it is the ripening, the swelling, of the fresh life within, that withers and bursts the husk.', 87, '1987-10-25'),
(1930, 'Male', 'Female', 'I am the admin', 99, '1999-06-05');
